export const customStyles = {
  control: (provided) => ({
    ...provided,
    marginTop: "8px",
    backgroundColor: "#F5F7F9",
    color: "#1D1A31",
    minHeight: 32,
    padding: "0"
  }),
  menu: (provided) => ({
    ...provided,
    fontSize: "12px",
    letterSpacing: "2px"
  })
};
